import styles from "../header/Header.module.css";

export default function Header() {
  return (
    <div className={styles.container}>
      <div></div>
      <ul
        style={{
          display: "flex",
          justifyContent: "space-around",
          alignItems: "center",
          listStyle: "none",
          position: "fixed",
          top: 0,
        }}
      >
        <li>content</li>
        <li>phortpolio</li>
        <li>contact us</li>
      </ul>
    </div>
  );
}
